BOSTON! I am coming for you!! COME SEE MY SHOW!

"A two-person variety show featuring comedian Toni Nagy and her 12-year old daughter Adelia Aldrich entitled “Go To Your Womb.” A show in 3 acts that will explore the shamanic transitions of birth, childhood, and becoming an adult seen from the perspective of both parent and child. Elements of feminism, family dynamics, girlhood, and the existential crisis of programming a human who then must learn to deprogram themselves will be on display. The show will be expressed through the mediums of storytelling, stand up, sketch comedy, and dance. The experience for the audience will be akin to a slightly inappropriate family friendly acid trip you’ll want to later process with a therapist." 
@rockwellthtr
